import React from "react";

const Score = ({ score }) => {
  return (
    <div>
      <div
        className={[
          "entity-score",
          score >= 80
            ? "green-value"
            : 79 > score && score > 60
            ? "orange-value"
            : "red-value",
        ].join(" ")}
      >
        {score ? score : 0}%
      </div>
      <div>Score</div>
    </div>
  );
};

export default Score;
